import React, { useState } from "react";
import emailjs from "emailjs-com";
import { motion } from "framer-motion";
import logo from "./assets/logo.png";
import successImage from "./assets/success.png";

export default function App() {
  const [formData, setFormData] = useState({ name: "", email: "" });
  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const sendEmail = (e) => {
    e.preventDefault();

    // Send to USER
    emailjs
      .send(
        "service_ted5m2h",
        "template_5qmfosa",
        {
          name: formData.name,
          email: formData.email,
        },
        "D8Cr-U9g1MVqsc5bv"
      )
      .then(() => console.log("Confirmation sent to user"));

    // Send to ADMIN
    emailjs
      .send(
        "service_ted5m2h",
        "template_nzvxr9o",
        {
          name: formData.name,
          email: formData.email,
        },
        "D8Cr-U9g1MVqsc5bv"
      )
      .then(() => setSubmitted(true));
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-teal-100 to-blue-100 text-gray-800 font-sans">
      {/* HEADER */}
      <header className="flex justify-between items-center p-6 shadow bg-white">
        <div>
          <h1 className="text-2xl font-bold">SafeCircle</h1>
          <p className="text-sm text-gray-500">When no one listens, we do.</p>
        </div>
        <img src={logo} alt="SafeCircle Logo" className="w-16 h-16" />
      </header>

      {/* HERO */}
      <motion.section
        initial={{ opacity: 0, y: -30 }}
        animate={{ opacity: 1, y: 0 }}
        className="text-center py-16 px-6"
      >
        <h2 className="text-4xl font-bold mb-4">Private and Trusted Mental Health Consultations</h2>
        <p className="max-w-xl mx-auto text-gray-600 text-lg">
          Get expert support anonymously. We are just a message away.
        </p>
      </motion.section>

      {/* PRICING */}
      <section className="bg-white py-10 px-4">
        <h3 className="text-2xl font-bold text-center mb-6">Pricing</h3>
        <div className="grid md:grid-cols-3 gap-6 max-w-4xl mx-auto">
          <div className="p-4 shadow rounded bg-teal-50">
            <h4 className="text-xl font-semibold">Quick Talk</h4>
            <p className="text-lg">â‚¹99 / session</p>
          </div>
          <div className="p-4 shadow rounded bg-teal-50">
            <h4 className="text-xl font-semibold">Detailed Session</h4>
            <p className="text-lg">â‚¹199 / session</p>
          </div>
          <div className="p-4 shadow rounded bg-teal-50">
            <h4 className="text-xl font-semibold">Follow-up Care</h4>
            <p className="text-lg">â‚¹200 / session</p>
          </div>
        </div>
      </section>

      {/* WHY TRUST US */}
      <section className="py-10 px-4">
        <h3 className="text-2xl font-bold text-center mb-4">Why Trust Us?</h3>
        <div className="max-w-3xl mx-auto text-center text-gray-700">
          <p className="mb-2">âœ… 100% Confidential</p>
          <p className="mb-2">âœ… Verified Experts</p>
          <p className="mb-2">âœ… Instant Booking & Flexible Slots</p>
        </div>
      </section>

      {/* BOOK SESSION */}
      <section className="bg-white py-10 px-6">
        <h3 className="text-2xl font-bold text-center mb-6">Book a Session</h3>
        {submitted ? (
          <div className="text-center">
            <img src={successImage} alt="Success" className="w-32 mx-auto mb-4" />
            <p className="text-xl font-semibold text-green-600">
              Your request has been submitted!
            </p>
          </div>
        ) : (
          <form onSubmit={sendEmail} className="max-w-xl mx-auto grid gap-4">
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              placeholder="Your Name"
              required
              className="p-3 rounded border border-gray-300"
            />
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="Your Email"
              required
              className="p-3 rounded border border-gray-300"
            />
            <div>
              <label className="block mb-1 font-bold">Upload Image Here (Payment Success)</label>
              <input
                type="file"
                className="block w-full text-sm text-gray-700"
                required
              />
            </div>
            <button
              type="submit"
              className="bg-teal-600 text-white py-2 rounded hover:bg-teal-700 transition"
            >
              Submit Booking
            </button>
          </form>
        )}
      </section>

      {/* CTA */}
      <section className="text-center py-10 bg-gradient-to-t from-blue-100 to-teal-100">
        <h4 className="text-xl font-semibold mb-2">Have questions or need help?</h4>
        <p className="mb-4">ðŸ“© Email us or ðŸ“± WhatsApp using the QR code below</p>
        <img src="./assets/QR.png" alt="WhatsApp QR" className="w-32 mx-auto" />
      </section>

      {/* FOOTER */}
      <footer className="text-center py-6 text-sm bg-white text-gray-500">
        &copy; {new Date().getFullYear()} SafeCircle. All rights reserved.
      </footer>
    </div>
  );
}
